import {useState} from 'react';
import './style.css'

const Navbar = () => {
    const Links = [
        { name: 'Home', link: '/' },
        { name: 'Home', link: '/' },
        { name: 'Home', link: '/' },
        { name: 'Home', link: '/' },
        
    ]
    const [open, setOpen] = useState(false);
    return (
        <nav>
            <div className='md:flex items-center justify-between bg-color-primary py-5  md:px-10 px-8'>
                <div className='text-white text-xl cursor-pointer'>
                    Yohanes.
                    <span>
                        Albert
                    </span>
                </div>
                <div onClick={()=>setOpen(!open)} className='text-3xl absolute right-8 top-6 cursor-pointer md:hidden'>
                    <ion-icon name={open ? 'close':'menu'}></ion-icon>
                </div>
                <ul className={`md:flex md:items-center md:pb-0 pb-12 md:static md:z-auto z-[-1] left-0 w-full md:w-auto md:pl-0 pl-9 transition-all duration-300 ease-in ${open?'top-20':'top-[-300px]'}`}>
                    {
                        Links.map((Link) => (  
                        <li key={Link.name} className='md:ml-8 md:my-0 my-7'><a href={Link.link} className='text-white hover:text-gray-200 duration-500 cursor-pointer'>{Link.name}</a></li>
                        ))
                    }
                </ul>
            </div>
        </nav>
    )
}

export default Navbar;
